import { useState } from "react";
import Login from "./Login";


function App() {
  const [user, setUser] = useState(null);

  return (
    <div>
      {!user && <Login setUser={setUser} />}

      {user?.role === "user" && <UserDashboard user={user} />}
      {user?.role === "admin" && <AdminDashboard />}
    </div>
  );
}

export default App;
